import React, { Component } from "react";
import "./Tour.scss";

export default class Tour extends Component {
  render() {
    return (
      <article>
        <div className="tour">
          <div className="img-container">
            <img
              width="200 "
              src="https://images.pexels.com/photos/1122410/pexels-photo-1122410.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
              alt="image"
            />
            <span className="close-btn">
              <i className="fas fa-window-close" />
            </span>
          </div>
          <h3>city</h3>
          <h4>tour</h4>
        </div>
      </article>
    );
  }
}
